import React from "react";
import Flip from "react-reveal/Flip";

class FlipText extends React.Component {
  render() {
    return (
      <div>
        <Flip left>
          <h1>React Reveal</h1>
        </Flip>
      </div>
    );
  }
}

export default FlipText;
